import React from 'react';
import Rating from 'material-ui-rating';

class Rate extends React.Component{
  render(){
    return(
        <Rating
            value={3}
            max={5}
            ratingColor='red'
            ratingBackgroundColor='#c8c7c8'
            onChange={(value) => console.log(`Rating is ${value}`)}/>
    )
  }
}
export default Rate
